<?php

namespace Tastd\Bundle\CoreBundle\Tests\Controller;
use Symfony\Component\HttpFoundation\File\UploadedFile;
use Tastd\Bundle\CoreBundle\Tests\Key\AuthToken;
use Tastd\Bundle\CoreBundle\Tests\Key\RefreshToken;


/**
 * Class UserControllerTest
 *
 * @package Tastd\Bundle\CoreBundle\Tests\Controller
 */
class UserControllerTest extends RestControllerTestCase
{

    /**
     * testUpdateAction
     */
    public function testUpdateAction()
    {
        $client = static::createClient();
        $data = array(
            "id"=> 1,
            "firstName" => 'gino',
            "lastName" => 'pino',
            "headline" => 'My funny headline',
            "birthYear" =>  1980,
            "about" => 'My description si awesome.',
            "uploadedAvatar" => "

"
        );
        $this->putRequest($client, 'api/users/1', AuthToken::CORRECT, $data);
        $this->assertEquals(200, $client->getResponse()->getStatusCode());
    }

    /**
     * testGetAllAction
     */
    public function testGetAllAction()
    {
        $client = static::createClient();
        $this->getRequest($client, 'api/users?query=user', AuthToken::CORRECT);
        $this->assertEquals(200, $client->getResponse()->getStatusCode());
    }

    /**
     * testGetAllWithIsMyLeaderAction
     */
    public function testGetAllWithIsMyLeaderAction()
    {
        $client = static::createClient();
        $this->getRequest($client, 'api/users?serializationGroups=isMyLeader', AuthToken::CORRECT);
        $this->assertEquals(200, $client->getResponse()->getStatusCode());
        $data = $this->getArrayFromClientResponse($client);
        $this->assertTrue(is_bool($data['users'][0]['isMyLeader']));
    }

    /**
     * testGetAllWithIsMyFollowerAction
     */
    public function testGetAllWithIsMyFollowerAction()
    {
        $client = static::createClient();
        $this->getRequest($client, 'api/users?serializationGroups=isMyFollower', AuthToken::CORRECT);
        $this->assertEquals(200, $client->getResponse()->getStatusCode());
        $data = $this->getArrayFromClientResponse($client);
        $this->assertTrue(is_bool($data['users'][0]['isMyFollower']));
    }

}